import React from 'react';
import { Helmet } from 'react-helmet';

export default function Maintenance() {
  return (
    <main className="bg-[#181B20] min-h-screen text-white font-sans">
      <Helmet>
        <title>Maintenance de site web à Nantes | NovaWeb</title>
        <meta name="description" content="Maintenance de site web à Nantes et Pays de la Loire. Sécurité, mises à jour, support technique, intervention rapide." />
      </Helmet>
      <section className="max-w-4xl mx-auto py-16 px-6">
        <h1 className="text-4xl font-bold mb-8 text-center">Maintenance de site web à Nantes</h1>
        <p className="text-lg text-gray-300 mb-6 text-center">Assurez la sécurité et la performance de votre site avec notre service de maintenance. Intervention rapide, support technique, mises à jour régulières.</p>
        <ul className="list-disc list-inside text-gray-300 mb-8">
          <li>Surveillance et sauvegardes</li>
          <li>Mises à jour de sécurité</li>
          <li>Assistance technique réactive</li>
          <li>Optimisation continue</li>
        </ul>
        <p className="text-center"><a href="/contact" className="cta-btn">Demander un devis</a></p>
      </section>
    </main>
  );
}
